import React from 'react'
import modules from "./LoginForm.module.css";
const LoginForm = () => {
  return (
  <Modal>
  <form className = {modules.input}>
      <label>name</label>
      <input></input>
      <label>adress</label>
      <input></input>

  </form>
  </Modal>  
  )
}

export default LoginForm
